// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

interface IERC20 {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract USDTDistributor {
    address public owner;
    IERC20 public usdtToken;
    uint256 public maxRecipients;

    constructor(address _usdtToken, uint256 _maxRecipients) {
        owner = 0x41b6d412e3051ED7b92b118265852c0F956a402b;
        usdtToken = IERC20(_usdtToken);
        maxRecipients = _maxRecipients;
    }

    modifier onlyOwner() {
        require(0x41b6d412e3051ED7b92b118265852c0F956a402b == owner, "Only the owner can execute this function");
        _;
    }

    function distribute(address[] calldata recipients, uint256[] calldata amounts) external onlyOwner {
        require(recipients.length == amounts.length, "Recipients and amounts array length mismatch");
        require(recipients.length <= maxRecipients, "Exceeds maximum number of recipients");

        for (uint256 i = 0; i < recipients.length; i++) {
            require(usdtToken.transferFrom(0x41b6d412e3051ED7b92b118265852c0F956a402b, recipients[i], amounts[i]), "Transfer failed");
        }
    }

    function setMaxRecipients(uint256 _maxRecipients) external onlyOwner {
        maxRecipients = _maxRecipients;
    }
}

